import React from 'react';

export const AppInfo = ({ data }) => {
  if (!data) return null;

  const { website, offers } = data;

  return (
    <div>
      <h2>Website Info</h2>
      <p>ID: {website.id}</p>
      <p>Link: {website.link}</p>
      <p>Type: {website.type}</p>
      <p>Country Code: {website.country_code}</p>
      <p>Country Name: {website.country_name}</p>

      <h2>Offers Info</h2>
      {offers.map((offer, index) => (
        <div key={index}>
          <p>ID: {offer.id}</p>
          <p>Name: {offer.name}</p>
          <p>Sub2: {offer.sub2}</p>
          {/* Додайте інші поля, які вам потрібні */}
        </div>
      ))}
    </div>
  );
};


export default AppInfo;
